		public static string ConvertFirst(string str)
		{
			string py = string.Empty;
			for (int i = 0; i < str.Length; i++)
			{
				string p = SpellHelper.Convert(str.Substring(i, 1));
				if (p != string.Empty)
					py += p.Substring(0, 1);
			}
			return py;
		}

		/// <summary>
		/// 汉字拼音
		/// </summary>
		/// <param name="chrstr"></param>
		/// <param name="capitalize">是否首字母大写</param>
		/// <returns></returns>
		public static string Convert(string chrstr, bool capitalize)
		{
			byte[] array = new byte[2];
			string returnstr = "";
			int chrasc = 0;
			int i1 = 0;
			int i2 = 0;
			char[] nowchar = chrstr.ToCharArray();
			for (int j = 0; j < nowchar.Length; j++)
			{
				if ((nowchar[j] >= 'a' && nowchar[j] <= 'z') || (nowchar[j] >= 'A' && nowchar[j] <= 'Z') || (nowchar[j] >= '0' && nowchar[j] <= '9'))
				{
					returnstr += nowchar[j];
					continue;
				}

				array = System.Text.Encoding.Default.GetBytes(nowchar[j].ToString());
				if (array.Length != 2)
				{
					returnstr += nowchar[j];
					continue;
				}
				else
				{
					i1 = (short)(array[0]);
					i2 = (short)(array[1]);
				}

				if (i2 - 160 < 10)
				{
					chrasc = int.Parse((i1 - 160).ToString() + "0" + (i2 - 160).ToString());
				}
				else
				{
					chrasc = int.Parse((i1 - 160).ToString() + (i2 - 160).ToString());
				}

				if (chrasc < 0 || chrasc > 9000)
				{
					returnstr += nowchar[j];
				}
				else
				{
					if (pyvalue[chrasc] >= 0)
					{
						var py = pystr[pyvalue[chrasc]];
						returnstr += capitalize ? py.Substring(0, 1).ToUpper() + py.Substring(1) : py;
					}
					else
					{
						returnstr += nowchar[j];
					}
				}
			}
			return returnstr;

		}

		/// <summary>
		/// 汉字拼音
		/// </summary>
		/// <param name="chrstr"></param>
		/// <returns></returns>
		public static string Convert(string chrstr)
		{
			return Convert(chrstr, false);
		}
	}
